import React from "react";
import { useNavigate } from "react-router-dom";

const Order = () => {
  const navigate = useNavigate();
  const goBack = () => {
    navigate("/");
  };
  return (
    <>
      <h1>Order Successful</h1>
      <button onClick={goBack}>Go Back</button>
    </>
  );
};

export default Order;
